import React, { Component } from "react";
import Navigation from "../Navbar";
import { connect } from "react-redux";
import * as actionCreators from "../../js/actions/index";
import { Row, Col } from "react-bootstrap";

class UserProfile extends Component {
  constructor(props) {
    super();
    this.state = {
      isEditable: false
    };
  }
  componentDidMount() {
    this.props.getUserProfile({ email: localStorage.getItem("email") });
  }
  render() {
    return (
      <div>
        <Navigation></Navigation>
        <div>
          <Row>
            <Col class="col-sm-3">
              <div class="vertical-menu">
                <a href="#" class="active">
                  Home
                </a>
                <a href="#">Link 1</a>
                <a href="#">Link 2</a>
                <a href="#">Link 3</a>
                <a href="#">Link 4</a>
              </div>
            </Col>
            <Col>Here</Col>
          </Row>
        </div>
      </div>
    );
  }
}

function mapStoreToProps(state) {
  return {
    users: state.userDetails,
    profile: state.userProfile
  };
}
export default connect(
  mapStoreToProps,
  actionCreators
)(UserProfile);
